  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the results of a
  seabird fledgling success study that took place from August 26th to September 8th,
  1989. Nest burrows were examined, seabirds were banded, transect surveys were taken,
  and stomach oil samples were collected. A description of the study area and methods
  used are discussed. Recommendations are also given. Data forms and maps of the study
  area are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
